import { HeaderImage, StyledNavbar, StyledContainer } from "./styles";
import logo from "./image1.svg";

export const Navbar = (probs) => {
  return (
    <StyledNavbar>
      <StyledContainer>
        <HeaderImage image={logo}>   
            <img src={logo} alt="image" />
               </HeaderImage>
               <ul>
                 <li>Movies</li>
                 <li>About</li>
                 <li>Offers</li>
                 <li>Offers</li>
               </ul>
      </StyledContainer>
      <StyledContainer>
         <span><a>+</a></span>
         <span><button>EN</button></span>
         <span><a>Login</a></span>
         <span><a></a>Join TMDB</span>
         <span>Search</span>
         </StyledContainer>
    </StyledNavbar>
  );
};
